window.bookSummaryJSON = "<p><b>Van's next mission has begun, and at the heart of it is the power to save lives.</b></p> <p>Meanwhile, a hungry galaxy looks to a brilliant young scientist for answers, making her the most wanted person in known space.</p> <p>After years of research, Adayluh Creel perfects a resource to feed sixteen races—or more—all with one golden plant capable of growing on the most hostile worlds. For her efforts, she wants nothing, but savage forces will seek to possess what she would give away for free, thus controlling the food source for billions of people.</p> <p>But Adayluh has powerful allies who know what's at stake, and the fight is on as the Guild, GKU, and other shadowy powers converge on one point, with one goal: save Adayluh, save the people, and end the Sorcerers forever.</p>"; 
